import React from 'react';
import { DateInput } from './components/DateInput';
import { Favorites } from './components/Favorites';
import { Launches } from './components/Launches';
import './App.scss';

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      startDate: "",
      endDate: "",
      launches: <Launches start="" end="" />
    }
  }
  dateCallBack = (start, end) => {
    this.setState({
      startDate: start,
      endDate: end,
      launches: <Launches start={this.state.startDate} end={this.state.endDate} />
    });
  }
  dateUpdate = (startDate, endDate) => {
    this.setState({
      start: startDate,
      end: endDate
    })
  }
  render = () => {
    return (
      <div className="app">
        <h1>Launches</h1>
        <DateInput callBack={this.dateCallBack} />
        {"start: " + this.state.startDate + " end: " + this.state.endDate}
        <Favorites favorites={[]} />
        {this.state.launches}
      </div>
    );
  }
}

export default App;
